// Utility functions
export const getBookById = (id) => SHARED_BOOKS.find(book => book.id === id);

export const getPublishedBooksCount = () =>
  SHARED_BOOKS.filter(book => book.status === "Published").length;

export const getBooksByRecipient = (recipientId) =>
  SHARED_BOOKS.filter(book => book.personId === recipientId);

  export const getRecentBooks = (limit = 3) =>
    [...SHARED_BOOKS]
      .filter(book => book.status === "Published")  // Only include published books
      .sort((a, b) => new Date(b.savedOn) - new Date(a.savedOn))
      .slice(0, limit);

/**
 * @typedef {Object} Book
 * @property {number} id
 * @property {string} name
 * @property {string} personName
 * @property {number} personId
 * @property {string} description
 * @property {number} count
 * @property {string} color - Tailwind color class
 * @property {string} savedOn - Relative time string
 * @property {'book'} type
 * @property {Array<BookPage>} pages
 */

/**
 * @typedef {Object} BookPage
 * @property {'question'|'answer'|'cover'} type
 * @property {string} [content] - For questions
 * @property {Object} [content] - For answers
 * @property {string} content.text
 * @property {string[]} content.points
 * @property {string} [image] - For covers
 * @property {number} pageNumber
 * @property {string} [createdAt]
 */
